import { format } from 'date-fns';
import { Link } from "react-router-dom";

export default function Post({ _id, title, courseOwner, summary, cover, createdAt, logofile }) {
  // const authorName = author?.username || "Anonymous"; 

  return (
    <div className="post">
      {cover && (
        <div className="image">
          <Link to={`/post/${_id}`}>
            <img
              src={`http://localhost:4050/${cover}`}
              alt={title || "Post cover"}
            />
          </Link>
        </div>
      )}
      

      <div className="texts">
        <Link to={`/post/${_id}`}>
          <h2>{title}</h2>
        </Link>
        <p className="info">
          <Link to={`/post/${_id}`} className="logofile">
          <img  
            src={logofile ? `http://localhost:4050/${logofile}` : "/default-logo.png"} 
            alt={title || "logofile"} 
            className="logofile-img"
          />
        </Link>

          <span className="postcourseOwner">{courseOwner}</span>
        </p>

        <p className="summary">{summary}</p>
          <time className='postTime'>{createdAt ? format(new Date(createdAt), 'yyyy-MM-dd')  : "Unknown date"}</time>
      </div>
    </div>
  );
}
